import PageMain from './PageMain';
import { usePageContext } from '../Context/RenderPage1';
import LoginPage from '../PageMains/LogInPage';
import DisplLogin from '../SignLogInComponents/DisplLogin';
import SignData from '../SignLogInComponents/SignData';
import SignInPage from '../PageMains/SignInPage';
import HomePageMain from '../PageMains/HomePageMain';
import startStudyingMain from '../PageMains/startStudyingMain';
import BuddyMain from '../Buddy/BuddyMain';
import StudyMain from '../PageMains/StudyMain';
import TimerPageMain from '../PageMains/TimerPageMain';
import { BuddyProvider } from '../Context/BuddyInfo';
import { BoardProvider } from '../Context/BulletinBoard';
import { AccountProvidor } from '../Context/AccountInfo';
function PageHolderSigned() {
  const { currPage } = usePageContext();
// rework by putting this inside page main for effeciency if needed
// move signed in and not sign to seperate files, prepare context in outer file, update context on sign in, use context
  return (
    <div >

      {((currPage === 1) || (currPage ===null)) && <LoginPage ComponentToRender={DisplLogin} props={"Log in"}/>}

      {(currPage ===2) && <SignInPage ComponentToRender={SignData} props={"Create New Account"}/>}
      <BuddyProvider>
<BoardProvider>
<AccountProvidor>
      {(currPage === 3) && <PageMain ComponentToRender={HomePageMain} props={"Main Page"}/>}
      {(currPage === 4) && <PageMain ComponentToRender={startStudyingMain} props={"Main Page"}/>}
      {(currPage === 5) && <PageMain ComponentToRender={BuddyMain} props={"Main Page"}/>}
      {(currPage === 6) && <PageMain ComponentToRender={TimerPageMain} props={"Main Page"}/>}
      {(currPage === 7) && <PageMain ComponentToRender={StudyMain} props={"Main Page"}/>}
      </AccountProvidor>
      </BoardProvider>
      </BuddyProvider>

    </div>
  );
}

export default PageHolderSigned;
